import {Router} from 'express';
import { deleteAlumno, getEdit, insertarAlumno, postEdit, renderIndex,renderTabla } from '../controllers/alumno.controlador';

const router = Router();
//Index
router.get('/',renderIndex );

router.get('/tabla', renderTabla);

//ALTAS
router.get('/altas',(req,res)=>{
    res.render('altas');
});

router.get('/tabla',(req,res)=>{
    res.render('tabla');
});


router.post('/alumnos/add',insertarAlumno);

//BAJAS
router.get('/alumnos/:id/delete', deleteAlumno);

//CAMBIOS
router.get('/alumnos/:id/edit', getEdit);
router.post('/alumnos/:id/edit' ,postEdit);

//Export
export default router;

